import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from "react-router-dom";
import AuthPage from "./components/AuthPage";
import UploadCSV from "./components/UploadCSV";
import AgentLists from "./components/AgentLists";
import AddAgent from "./components/AppAgent"; // Ensure this is AddAgent.js
import './style.css';

function App() {
  const [user, setUser] = useState(null);
  const [token, setToken] = useState(localStorage.getItem("token") || "");
  const [agents, setAgents] = useState([]);

  useEffect(() => {
    if (token && !user) {
      fetchUser();
      fetchAgents();
    }
  }, [token]);

  // Fetch logged-in user
  const fetchUser = async () => {
    try {
      const res = await fetch("http://localhost:5000/api/auth/me", {
        headers: { Authorization: `Bearer ${token}` },
      });
      const data = await res.json();
      setUser(data);
    } catch (err) {
      console.error("Failed to fetch user", err);
      handleLogout();
    }
  };

  // Fetch all agents for internal use (not for nav bar)
  const fetchAgents = async () => {
    try {
      const res = await fetch("http://localhost:5000/api/agents", {
        headers: { Authorization: `Bearer ${token}` },
      });
      const data = await res.json();
      setAgents(data);
    } catch (err) {
      console.error("Failed to fetch agents", err);
    }
  };

  const handleLogout = () => {
    setUser(null);
    setToken("");
    localStorage.removeItem("token");
  };

  return (
    <Router>
      <div>
        {/* Top bar with Welcome & Logout */}
        {user && (
          <div style={{ padding: "10px", textAlign: "right" }}>
            <span>Welcome, {user.name} </span>
            <button onClick={handleLogout} style={{ marginLeft: "10px", padding: "5px 10px" }}>
              Logout
            </button>
          </div>
        )}

        {/* Navigation bar */}
        {user && (
          <nav style={{ padding: "10px", textAlign: "center" }}>
            <Link to="/add-agent" style={{ margin: "0 10px" }}>Add Agent</Link>
            <Link to="/upload" style={{ margin: "0 10px" }}>Upload CSV</Link>
            <Link to="/agents" style={{ margin: "0 10px" }}>All Agents</Link>
            {/* Individual agent links removed from nav bar */}
          </nav>
        )}

        {/* Routes */}
        <Routes>
          {/* Default route */}
          <Route
            path="/"
            element={user ? <Navigate to="/upload" /> : <AuthPage setUser={setUser} setToken={setToken} />}
          />

          {/* Add agent */}
          <Route
            path="/add-agent"
            element={user ? <AddAgent token={token} /> : <Navigate to="/" />}
          />

          {/* Upload CSV */}
          <Route
            path="/upload"
            element={user ? <UploadCSV token={token} /> : <Navigate to="/" />}
          />

          {/* All agents */}
          <Route
            path="/agents"
            element={user ? <AgentLists token={token} /> : <Navigate to="/" />}
          />

          {/* Specific agent's lists */}
          <Route
            path="/agent/:id"
            element={user ? <AgentLists token={token} /> : <Navigate to="/" />}
          />

          {/* Fallback */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
